Rectangle $ABCD$ has center $O$ and $AB/AD=k$. A point is randomly chosen from the interior of rectangle $ABCD$. What is the probability that it is closer to $O$ than to any of the four vertices?  [asy]
size(200);
draw((-250,100)--(250,100)--(250,-100)--(-250,-100)--cycle);
dot((0,0));
label("$O$",(0,0),N);
label("$A$",(-250,100),NW); label("$B$",(250,100),NE); label("$C$",(250,-100),SE); label("$D$",(-250,-100),SW);[/asy]

In the diagram below, we have $AB = 24$ and $\angle ADB =90^\circ$.  If $\sin A = \frac23$ and $\sin C = \frac34$, then what is $BC$?


[asy]
pair A,B,C,D;
A = (0,0);
B = (8*sqrt(5),16);
D = (8*sqrt(5),0);
C = (8*sqrt(5) + 5.3333*sqrt(7),0);
draw(D--B--A--C--B);
label("$A$",A,SW);
label("$B$",B,N);
label("$C$",C,SE);
label("$D$",D,S);
draw(rightanglemark(B,D,A,43));
[/asy]

In rectangle $ABCD$, $AD=1$, $P$ is on $\overline{AB}$, and $\overline{DB}$ and $\overline{DP}$ trisect $\angle ADC$. Write the perimeter of $\triangle BDP$ in simplest form as:  $w + \frac{x \cdot \sqrt{y}}{z}$, where $w, x, y, z$ are nonnegative integers.  What is $w + x + y + z$?

[asy]
pair A,B,C,D,P;
A=(0,5);
B=(8,5);
C=(8,0);
D=(0,0);
P=(3,5);
draw(A--B--C--D--cycle);
draw(P--D--B);
label("$A$",A,N);
label("$B$",B,N);
label("$C$",C,S);
label("$D$",D,S);
label("$P$",P,N);
[/asy]

On the game board below Kendra will start at the center of the board. For each turn she will spin this spinner with four congruent sectors once, and then she will move one space in the direction indicated on the spinner. The "Start'' square does not have a numerical value, but Kendra may land on it during her turns. What is the probability that the sum of the numbers in the spaces on which she will land will be exactly 30 after her third complete turn? Express your answer as a common fraction.

[asy]size(80);
import graph;
draw(Circle((0,0),1),linewidth(1));
draw((-1,0)--(1,0),linewidth(1)); draw((0,-1)--(0,1),linewidth(1));
label("Move",(sqrt(2)/4,sqrt(2)/4+.15),fontsize(10pt));
label("Left",(sqrt(2)/4,sqrt(2)/4-.15),fontsize(10pt));
label("Move",(-sqrt(2)/4,sqrt(2)/4+.15),fontsize(10pt));
label("Right",(-sqrt(2)/4,sqrt(2)/4-.15),fontsize(10pt));
label("Move",(-sqrt(2)/4,-(sqrt(2)/4-.15)),fontsize(10pt));
label("Down",(-sqrt(2)/4,-(sqrt(2)/4+.15)),fontsize(10pt));
label("Move",(sqrt(2)/4,-(sqrt(2)/4-.15)),fontsize(10pt));
label("Up",(sqrt(2)/4,-(sqrt(2)/4+.15)),fontsize(10pt));
dot((0,0),linewidth(5)); draw((0,0)--1/2 dir(-70),linewidth(1.5),EndArrow(5));[/asy]

[asy]size(200);
