draw((-8.5+2.5i,2+1.5i)--(-8.5+2.5i,-2-1.5i),linewidth(1));
}
draw((8.5,0)--(-8.5,0),linewidth(1));
draw((0,5)--(0,-5),linewidth(1));
filldraw((-1,1)--(1,1)--(1,-1)--(-1,-1)--cycle,white,linewidth(1)); label("Start",(0,0),fontsize(8pt));
b10(0,2); b10(-3.5,2); b10(3.5,2); b10(-3.5,0); b10(3.5,0); b10(0,-2); b10(-3.5,-2); b10(3.5,-2); b10(3.5,5); b10(-3.5,5); b10(3.5,-5); b10(-3.5,-5);
b5(6,0); b5(8.5,0); b5(0,3.5); b5(0,5); b5(0,-3.5); b5(0,-5); b5(3.5,-3.5); b5(3.5,3.5);b5(-3.5,-3.5);b5(-3.5,3.5); b5(-6,0); b5(-8.5,0);

b20(6,3.5); b20(6,-3.5); b20(-6,3.5); b20(-6,-3.5); b20(8.5,2); b20(-8.5,2); b20(8.5,-2); b20(-8.5,-2);

b15(6,2); b15(6,-2); b15(-6,2); b15(-6,-2);[/asy]

In $\triangle ABC$, $AB = 13$, $AC=5$ and $BC=12$.  Points $M$ and $N$ lie on $\overline{AC}$ and $\overline{BC}$, respectively, with $CM = CN = 4$. Points $J$ and $K$ are on $\overline{AB}$ so that $\overline{MJ}$ and $\overline{NK}$ are perpendicular to $\overline{AB}$. What is the area of pentagon $CMJKN$? Express your answer as a common fraction.

[asy]
pair A,B,C,N,K,M,J;
A=(0,5);
B=(12,0);
C=(0,0);
N=(5,0);
M=(0,4);
J=(0.35,4.84);
K=(6,2.4);
draw(A--B--C--cycle,linewidth(0.7));
draw(N--K,linewidth(0.7));
draw(M--J,linewidth(0.7));
label("$A$",A,NW);
label("$M$",M,W);
label("$C$",C,SW);
label("$N$",N,S);
label("$B$",B,SE);
label("$K$",K,NE);
label("$J$",J,NE);
[/asy]

Let \[f(n) =
\begin{cases}
4n+3 &\text{if }n<a, \\
7n-12 &\text{if }n\ge{a}.
\end{cases}
\]Find $a$ if the graph of $y=f(n)$ is continuous.

In the diagram, the four points have coordinates $A(0,1)$, $B(1,3)$, $C(5,2)$, and $D(4,0)$.  What is the area of quadrilateral $ABCD$? [asy]
// draw axis
real low = -1; real high = 6;
draw((low, 0)--(high, 0), Arrow); draw((0, low)--(0, high - 1.5), Arrow);
label("$x$", (high, 0), E); label("$y$", (0, high - 1.5), N);

// draw quadrilateral
pair a = (0, 1); pair b = (1, 3); pair c = (5, 2); pair d = (4, 0);
draw(a--b--c--d--cycle);
label("$A$", a, W); label("$B$", b, N); label("$C$", c, E); label("$D$", d, S);
[/asy]

