To play BINGO, someone names numbers, chosen at random, and players mark those numbers on their cards.  A player wins when he marks 5 in a row, horizontally, vertically, or diagonally.

How many distinct possibilities are there for the values in the diagonal going from top left to bottom right of a BINGO card, in order?

The letters C, O, U, N and T are randomly placed around a circle. One such arrangement is shown here. If we always start with the C and continue to read the rest of the letters in order clockwise, in how many different orders can the letters appear?

[asy]
draw(circle((0,0),1),dashed);
label("U",dir(90));
label("C",dir(90+360/5));
label("O",dir(90+2*360/5));
label("N",dir(90+3*360/5));
label("T",dir(90+4*360/5));
[/asy]

The following line is parameterized, so that its direction vector is of the form $\begin{pmatrix} -7 \\ b \end{pmatrix}.$  Find $b.$

[asy]
unitsize(0.4 cm);

pair A, B, L, R;
int i, n;

for (i = -8; i <= 8; ++i) {
  draw((i,-8)--(i,8),gray(0.7));
  draw((-8,i)--(8,i),gray(0.7));
}

draw((-8,0)--(8,0),Arrows(6));
draw((0,-8)--(0,8),Arrows(6));

A = (-5,4);
B = (-1,3);
L = extension(A, B, (-8,0), (-8,1));
R = extension(A, B, (8,0), (8,1));

draw(L--R, red);

label("$x$", (8,0), E);
label("$y$", (0,8), N);
[/asy]

In the diagram, four squares of side length 2 are placed in the corners of a square of side length 6.  Each of the points $W$, $X$, $Y$, and $Z$ is a vertex of one of the small squares.  Square $ABCD$ can be constructed with sides passing through $W$, $X$, $Y$, and $Z$. What is the maximum possible distance from $A$ to $P$? [asy]
path square = scale(2) * unitsquare;

draw(square); draw(shift(4) * square); draw(shift(4, 4) * square); draw(shift(0, 4) * square);
draw((2, 0)--(4, 0)); draw((0, 2)--(0, 4)); draw((6, 2)--(6, 4)); draw((2, 6)--(4, 6));

pair a = shift(3, 4) * dir(135);
pair b = shift(4, 3) * dir(45);
pair c = shift(3, 2) * dir(-45);
pair d = shift(2, 3) * dir(-135);
draw(a--b--c--d--cycle);

label("$2$", (1, 6), N); label("$2$", (3, 6), N); label("$2$", (5, 6), N);

label("$2$", (6, 5), E); label("$2$", (6, 3), E); label("$2$", (6, 1), E);

label("$W$", (2, 4), NW); label("$X$", (4, 4), NE); label("$Y$", (4, 2), SE); label("$Z$", (2, 2), SW);
label("$A$", a, N); label("$B$", b, E); label("$C$", c, S); label("$D$", d, W); label("$P$", (6, 0), SE);
[/asy]

